import React from "react";
import { Button, Container, Divider, Paper, TextField, Typography } from "@mui/material";
import { Box, Stack } from "@mui/system";
import AddIcon from "@mui/icons-material/Add";

function ClientesBusqueda() {
    const boxStyle = {
        sx: {
            width: "100vw",
            minHeight: "100vh",
            height: "100%",
            backgroundColor: "#dbdbdb",
            m: 0,
            p: 0,
        },
    };

    const paperStyle = {
        sx: {
            width: "80vw",
        },
    };

    const inputsStackStyle = {
        sx: {width:'50%'}
    }

    return (
        // <Container fixed>
            <Box {...boxStyle}>
                <Container>
                <Stack {...paperStyle} direction={"row"} justifyContent="space-between">
                    <Typography variant="h6">Personas</Typography>
                    <Button variant="filled">
                        <AddIcon />
                        Nuevo
                    </Button>
                </Stack>
                <Paper {...paperStyle}>
                    <Typography variant={"h6"}>Filtros</Typography>
                    <Divider/>
                    <Stack {...inputsStackStyle}>
                    <Typography variant={"body2"}>Nombre</Typography>
                    <TextField></TextField>
                    </Stack>


                </Paper>
                </Container>
            </Box>
        // </Container>
    );
}

export default ClientesBusqueda;
